  - 개시자, 발신자, 발신자: INVITE 요청으로 세션(및 대화)을 시작하는 당사자입니다. 호출자는 대화를 설정한 초기 INVITE를 보낸 시점부터 해당 대화가 종료될 때까지 이 역할을 유지합니다.
